import React from 'react'
import {useRouter} from 'next/router'
import Link from  "next/link"


const  route = [
    {name:"abuchi", age:"32"},
    {name:"Onyeka", age:"30"},
    {name:"Kenchi", age:"30"},
    {name:"Amaka", age:"22"}
]

function sec() {

    return (
        <div>
            {route.map(e => (
                <div>
                <Link as={`/${e.name}/${e.age}`} href="/[name]/[age]">
                <a>{e.name} seen to be {e.age} </a>
            </Link>
            </div>
            ))
        }   
        </div>
    )
}

export default sec
